import React from 'react'
import StudentSidebar from './StudentSidebar'

function StudentMyEvent() {
  return (
    <>
      <StudentSidebar/>
      <div
        style={{
          paddingLeft: "22%",
          height: "100%",
          paddingTop: "100px",
        }}
      ></div>
    </>
  )
}

export default StudentMyEvent
